#include "OOLC.h"

static void sceneReady(scene& scn, player& p);
static void sceneEnd(scene& scn);
void suidao(player& p) {
	scene suidao;
	sceneReady(suidao, p);
	suidao.gameStart();
    //动画
    try {
        while (1) {
            suidao.printMap();
 
            suidao.playerDo();//其他按键功能
            suidao.NPCDo();
            suidao.playerMove();
            suidao.NPCMove();
            suidao.esc();

            Sleep(50);
        }
    }
    catch (int) {//换地图，地图文件存档

    }
    catch (const char*) {//退出
        p.exit = 1;
    }
    sceneEnd(suidao);
}

